import React, { useState } from 'react';
import './venue_carousel.css'

const Carousel = () => {
    const [num1, setNum1] = useState(1);
    const [num2, setNum2] = useState(1);
    const [num3, setNum3] = useState(2023);
    const [hourValStart, setNum4] = useState(1);
    const [minValStart, setNum5] = useState(0);
    const [hourValEnd, setNum6] = useState(1);
    const [minValEnd, setNum7] = useState(0);

    const incDate = () => {
        if (num1<31)
            setNum1(num1 + 1);
    }

    const decDate = () => {
        if (num1> 1)
            setNum1(num1 - 1);
    }

    const incMonth = () => {
        if (num2<12)
            setNum2(num2 + 1);
    }

    const decMonth = () => {
        if (num2> 1)
            setNum2(num2 - 1);
    }

    const incYear = () => {
        if (num3<2040)
            setNum3(num3 + 1);
    }

    const decYear = () => {
        if (num3> 2023)
            setNum3(num3 - 1);
    }

    const inchourStart = () => {
        if (hourValStart<12)
            setNum4(hourValStart + 1);
    }

    const dechourStart = () => {
        if (hourValStart> 1)
            setNum4(hourValStart - 1);
    }

    const incminStart = () => {
        if (minValStart<55)
            setNum5(minValStart + 5);
    }

    const decminStart = () => {
        if (minValStart> 0)
            setNum5(minValStart - 5);
    }

    const inchourEnd = () => {
        if (hourValEnd<12)
            setNum6(hourValEnd + 1);
    }

    const dechourEnd = () => {
        if (hourValEnd> 1)
            setNum6(hourValEnd - 1);
    }

    const incminEnd = () => {
        if (minValEnd<55)
            setNum7(minValEnd + 5);
    }

    const decminEnd = () => {
        if (minValEnd> 0)
            setNum7(minValEnd - 5);
    }

    return(
        <>
            <div className='btn-container-date'>
                <div className='btn-container-col-1'>
                    <label>Date</label>
                    <div className='btn-div'>
                        <p><button onClick={decDate}>-</button>
                        <span>{num1}</span>
                        <button onClick={incDate}>+</button></p>
                    </div>
                </div>
                <div className='btn-container-col-1'>
                    <label>Month</label>
                    <div className='btn-div'>
                        <p><button onClick={decMonth}>-</button>
                        <span>{num2}</span>
                        <button onClick={incMonth}>+</button></p>
                    </div>
                </div>
                <div className='btn-container-col-1'>
                    <label>Year</label>
                    <div className='btn-div'>
                        <p><button onClick={decYear}>-</button>
                        <span>{num3}</span>
                        <button onClick={incYear}>+</button></p>
                    </div>
                </div>
            </div>

            <label>Time</label>

            <div className='btn-container-time'>
                <div className='btn-container-col-1'>
                    <div className='btn-div'>
                        <p><button onClick={dechourStart}>-</button>
                        <span>{hourValStart}</span>
                        <button onClick={inchourStart}>+</button></p>
                    </div>
                </div>
                <div className='btn-container-col-1'>
                    <div className='btn-div'>
                        <p><button onClick={decminStart}>-</button>
                        <span>{minValStart}</span>
                        <button onClick={incminStart}>+</button></p>
                    </div>
                </div>
            </div>
            <label>To</label>
            <div className='btn-container-time'>
                <div className='btn-container-col-1'>
                    <div className='btn-div'>
                        <p><button onClick={dechourEnd}>-</button>
                        <span>{hourValEnd}</span>
                        <button onClick={inchourEnd}>+</button></p>
                    </div>
                </div>
                <div className='btn-container-col-1'>
                    <div className='btn-div'>
                        <p><button onClick={decminEnd}>-</button>
                        <span>{minValEnd}</span>
                        <button onClick={incminEnd}>+</button></p>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Carousel;
